def strip_img(width=2, shape=(200,200)):
  img = np.zeros(shape)
  M,N = shape
  strip = 'w'
  for i in range(0, N, width):
    if strip == 'b':
      img[:,i:(i+width)] = 0
      strip='w'
    else:
      img[:,i:(i+width)]=255
      strip='b'
  return img

