def make_rect(size):
  img = np.zeros((100,100), dtype = np.uint8)
  M,N = img.shape
  c_row = M//2
  c_col = N//2
  rec_m, rec_n = size
  # creating rectangle in the middle
  img[(c_row - (rec_m//2)): (c_row+(rec_m//2)),
      (c_col - (rec_n//2)): (c_col+(rec_n//2))] = 255

  return img
img1 = make_rect((25,25))
